import React from "react";
import "./ActionModal.css";
import { FaHandshake, FaChartLine, FaBuilding } from "react-icons/fa";
import logo from '../assets/logo/logo.png';

const ActionModal = ({ onClose }) => {
  return (
    <div className="modal-overlay">
      <div className="modal-content">
        <button className="modal-close" onClick={onClose}>
          &times;
        </button>

        {/* Logo */}
        <div className="modal-logo">
          <img src={logo} alt="FranExpo Logo" />
        </div>

        {/* Heading */}
        <h2 className="modal-title">Join FranExpo 2025</h2>
        <p className="modal-subtitle">
          Explore endless opportunities, connect with industry leaders, and grow your network.
        </p>

        {/* Benefits Section */}
        <div className="modal-benefits">
          <div className="benefit-card">
            <FaHandshake className="benefit-icon" />
            <p>Connect with 100+ Brands</p>
          </div>
          <div className="benefit-card">
            <FaChartLine className="benefit-icon" />
            <p>Learn from Industry Experts</p>
          </div>
          <div className="benefit-card">
            <FaBuilding className="benefit-icon" />
            <p>700+ Business Visitors</p>
          </div>
        </div>

        {/* Action Buttons */}
        <div className="modal-buttons">
          <button className="modal-btn stall">Stall Booking</button>
          <button className="modal-btn sponsor">Sponsor Registration</button>
          <button className="modal-btn investor">Investor Registration</button>
        </div>
      </div>
    </div>
  );
};

export default ActionModal;
